/**
 * @param {string} s
 * @param {string} t
 * @return {character}
 */
var findTheDifference = function (s, t) {
  function removeNonLetters(str) {
    return str.replace(/[^a-zA-Z]/g, '');
  }
  removeNonLetters(s);

  let store = {};
  for (let index = 0; index < removeNonLetters(s).length; index++) {
    const element = removeNonLetters(s)[index];
    store[element] = index;
  }

  for (let index = 0; index < removeNonLetters(t).length; index++) {
    const element = removeNonLetters(t)[index];
    if (element in store) {
      if (t.length !== s.length) return element;
      else store[element] = index;
    } else {
      return element;
    }
  }
};

console.log(findTheDifference('abcd', 'abcde'));
console.log(findTheDifference('', 'y'));
console.log(findTheDifference('a', 'aa'));
console.log(findTheDifference('ae', 'aea'));
console.log(
  findTheDifference(
    '""',
    '""'
  )
);
